import React from "react";

function AllpostPage({ posts, logedinUser }) {
  function openPost() {
    console.log("test");
  }

  return (
    <div className="posts">
      {posts.map((x, i) => (
        <div onClick={openPost} className="singlepost">
          <img src={x.image} alt="" />
          <div>{x.title}</div>
          <div>{x.location}</div>
          <div>{logedinUser.email}</div>
        </div>
      ))}
    </div>
  );
}

export default AllpostPage;
